import React, { Component } from "react";
import Navbar from "../Component/Navbar";
import Home from "../Component/home";
import About from "../Component/about";
import headshot from "../images/headshot.jpg";
import instagram from "../images/instagram.png";
import github from "../images/github.png";
import linkdlen from "../images/linkdlen.png";
import twitter from "../images/twitter.png";
import resume from "../images/resume.png";
import email from "../images/email.png";
import PDF from "../images/resume.pdf";

let dummyText = `Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Id nibh tortor id aliquet. Sed lectus vestibulum mattis ullamcorper velit sed. Nec nam aliquam sem et tortor. Elit eget gravida cum sociis natoque. Ipsum a arcu cursus vitae. Massa sapien faucibus et molestie ac feugiat sed. Turpis egestas maecenas pharetra convallis posuere morbi leo. Duis at consectetur lorem donec massa sapien fau`;
let about_text =
  "I am currently completing my undergraduate studies in Computer Engineering at the University of Illinois, along with a minor in business. My primary interest lies in Product Management for Software Engineering teams focused on AI, Cloud, Big Data, and Security. I have previous experience in the field of consutling, business development, and data. more information can be found in the section below.";
let contact_text =
  "If you are interested in connecting, or just want to chat, feel free to check out my resume and reach out to me on any platform below!";
let Welcome_text = `Hi, My name is Mahip Deora and welcome to my personal website! Below you will find information about my past experinces and project.`;

export default class NavbarLinker extends Component {
  render() {
    return (
      <div className="NavBarLinker">
        <Navbar />
        <Home
          title="Home"
          subtitle={Welcome_text}
          contact_text={contact_text}
          dark={true}
          id="Home"
          pic1={github}
          pic2={linkdlen}
          pic3={instagram}
          pic4={twitter}
          pic5={resume}
          pic6={email}
          Pdf={PDF}
        />
        <About
          title="About"
          subtitle={about_text}
          dark={false}
          id="About"
          img_src={headshot}
        />
        <Home
          title="Professional Experience"
          subtitle={dummyText}
          dark={true}
          id="Professional Experience"
        />
        <Home
          title="Extracurriculars"
          subtitle={dummyText}
          dark={false}
          id="Extracurriculars"
        />
      </div>
    );
  }
}
